INSERT INTO `products` (`id`, `brand_id`, `mlb_id`, `title`, `slug`, `sku`, `description`, `cost_price`, `selling_price`, `size`, `size_unit`, `height`, `width`, `length`, `weight_unit`, `weight`, `visibility`, `created_at`, `updated_at`, `deleted_at`) VALUES
(29, NULL, NULL, 'Tie Dye Bucket Hat', 'tie-dye-bucket- hat', NULL, '<p>This Tie Dye custom Bucket Hat is the perfect accessory for your spring and summer wardrobe. made from 100% cotton which makes it durable and comfortable to wear. At the back of the hat is an adjustable strap closure that makes it the perfect fit for all head sizes. The personalized tie-dye hat has a low profile, and an unstructured design that makes it great for embroidered designs. The interior of the hat has a built-in sweatband that makes this hat comfortable to wear even in the warmest weather. Create your own custom embroidered bucket hats using the CapBeast hat maker. Upload your design or add custom stitched text to make the perfect hat, with no minimum order sizes. Features · Unisex design · 100% cotton material · Unstructured design · Sewn eyelets · No minimums · Custom Embroidered</p>', 12.00, 29.00, '[null]', 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 11:58:53', '2025-04-17 04:37:08', NULL),
(30, 25, NULL, 'Black Bucket Hat | Sportman', 'black-bucket-hat-sportman', NULL, 'The black bucket hat by Sportman is made from 100% cotton material. It’s bio-washed chino twill makes it lightweight, comfortable, and environmentally friendly. The material is also sweat-wicking and easy to maintain. This custom embroidered hat has an unstructured design that ensures it can be folded and stored in a pocket or bag. It has a unisex design that makes it suitable for both men and women. The custom bucket hat has a black color that will enable it to go with most of your outfits. It has sewn eyelets that add to its breathability. Create your own by using the CapBeast custom hat maker. Stitch your design or catchphrase on your hat to make it a one-of-a-kind hat that will be sure to turn heads. Features · Bio-washed chino twill · Made of Eyelet design · Unstructured · Customizable · No Minimums', NULL, 28.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 12:09:02', '2025-04-17 04:17:29', NULL),
(31, NULL, NULL, 'Purple Passion Tie Dye Bucket Hat', 'purple-passion-tie-dye-bucket-hat', NULL, 'This purple passion tie-dye bucket hat has a vibrant, casual, and trendy look that will make you stand out from the crowd. It’s made of 100% cotton which makes it very comfortable to wear. The hat has a short brim that helps to protect you from UV rays. This custom embroidered hat has eyelets that allow fresh air to cool your head. It’s machine washable, and is one size fits all. The personalized tile dye hat features an unstructured design that makes it collapsible and foldable. It can also be washed regularly without losing its form. Design your own hat using the custom hat maker tool. Upload your logo or design and we will turn it into a unique one-of-a-kind hat. Features · Made of cotton material · Sewn eyelets · Unstructured design · Design your own · No minimums · Custom Embroidered', NULL, 29.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 12:16:27', '2025-03-24 12:16:27', NULL),
(32, NULL, NULL, 'Raspberry Mist Tie Dye Bucket Hat', 'raspberry-mist-tie-dye-bucket-hat', NULL, 'This Raspberry mist tie-dye bucket hat is made of 100% cotton material making it comfortable and lightweight. It’s a good choice for protecting you from harmful UV rays. The custom bucket hat has a low profile and an unstructured design that provides a comfortable and secure fit all the time. It has an easy-to-wear and comfortable casual shape that makes it your perfect outdoor companion. The hat comes with sewn eyelets that will keep you cool in the summer heat. This personalized tie-dye hat can be easily packed in your bag. It’s beautiful, stylish, and timeless. It will add a fashion flair to your style. Designing your custom embroidered hat has never been easier with our hat maker tool. Simply upload your logo and we will create a custom embroidered bucket hat that is unique to you. No minimums. Features · 100% cotton material · Sewn eyelets · Tie & dye prints · Unstructured design · Customize your design · No minimums', NULL, 29.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 12:23:20', '2025-03-24 12:23:20', NULL),
(33, NULL, NULL, 'Sky Tie Dye Bucket Hat', 'sky-tie-dye -bucket-hat', NULL, '<p>This Sky Tie Dye Custom Bucket Hat is made of 100% cotton that is soft, comfortable, and breathable. It has an unstructured design which helps the hat to keep it’s shape, even after it has been washed. The personalized cap has sewn eyelets to help keep your head cool in the summer heat, and has a unisex design that makes it suitable for both men and women. This custom hat will add a casual look in a fun and fashionable way. It’s the perfect accessory for any outfit. Design your own bucket hat using the Capbeast custom hat maker. Features · Cotton material · Sewn eyelets · Create your own · Unstructured design · Option to customize · No minimums</p>', NULL, 29.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 12:28:28', '2025-03-27 16:02:54', NULL),
(34, NULL, NULL, 'Cotton Candy Tie Dye Bucket Hat', 'cotton-candy-tie-dye-bucket-hat', NULL, 'The cotton candy tie dye bucket hat is made of a twill cotton material that makes it comfortable, breathable, and fade-proof. It features a stylish unstructured design and a low profile that makes it a good choice for all head sizes. The custom hat has sewn ventilation eyelets that provide breathing space for your head. It offers ample protection while making you look smart and trendy. The bucket hat has a stylish tie-dye design to help you stand out from the crowd. The bucket design is a good choice for protecting you from the sun. It’s sun-proof, sweatproof, and has an odor-fighting function, ensuring your all-day comfort. Design your own custom hat with the CapBeast hat maker. Upload your logo, design or text to create a one of a kind embroidered hat that features your brand. Features · 100% cotton material · Unstructured design · Eyelets · Flat top · Create your own design · Custom embroidered · No minimums', NULL, 29.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 12:34:43', '2025-03-24 12:34:43', NULL),
(35, NULL, NULL, 'Ocean Tie Dye Bucket Hat', 'ocean-tie-dye-bucket-hat', NULL, 'This Ocean Tie Dye Bucket hat is a must-have accessory in your wardrobe. It’s made from 100% cotton material which makes it the perfect choice for outdoor activities. The cap has eyelets on its brim that allows air to cool your head. This personalized bucket hat features a short brim and flat top that makes it suitable for all head sizes. It has an unstructured design that makes it foldable and packable in a bag. Our custom embroidered hat is perfect for people of all ages who want to look stylish in any weather. Personalize your own bucket hat by using the Capbeast custom hat maker. Features · Made of cotton material · Sewn eyelet · Unstructured design · Design Your Own · Flat top structure · Custom embroidered · No minimums', NULL, 29.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 12:43:52', '2025-03-24 12:43:52', NULL),
(36, 25, NULL, 'White Bucket Hat | Sportman', 'white-bucket-hat-sportman', NULL, 'This white bucket hat gives a retro look and feel that matches almost any outfit. Made of soft Bio-washed chino twill, it’s comfortable and durable. The cotton material is also soft and lightweight. The cap is one size fits all and comes with sewn eyelets that make the hat breathable, and quick-drying. It features a collapsible non-structured material that makes it easy to fold and fit in your bag or pocket. Create your own with the custom hat maker. Features · Sewn eyelet · Bio-washed chino twill · Unstructured design · Custom embroidered · White in color · No minimums', NULL, 28.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 12:49:12', '2025-03-27 13:54:10', NULL),
(39, 25, NULL, 'Gray Bucket Hat | Sportman', 'Grey-bucket-hat-sportman', NULL, 'The gray Custom Bucket Hat from Sportsman is made from 100% chino twill material. Made to withstand harsh outdoor elements such as sun, rain, and snow. It comes with stitched eyelets that make it breathable. The cap has a fairly deep crown that ensures a perfect fit. Its brim is wide enough to provide cover from the harsh UV rays. It has a toned-down gray color that enables it to match most outfits. The hat is flexible, foldable, and provides a casual, fun, and upbeat mood. With its comfortable and lightweight material, it\'s a must-have accessory in your wardrobe. This custom bucket hat is unisex and has a stylish design. Features · Sewn eyelet · unstructured design · 100% bio-washed chino twill material', NULL, 28.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 14:01:48', '2025-03-27 14:01:08', NULL),
(40, 25, NULL, 'Royal Bucket Hat | Sportman', 'royal-bucket-hat-sportman', NULL, 'With its wide brim, this Royal bucket hat is the best choice for protecting you from the harsh sun and wind. It’s made of bio-washed chino twill material that makes it durable, fade-resistant, and able to withstand the outdoor environment. The custom bucket features sewn in eyelets that adds to its breathability. With its unstructured design, it can be easily folded for travel. It has a simple but classic look that can be matched with various casual wear and denim. Design your own by uploading your logo or text in our hat maker. Create a one-of-a-kind custom embroidered hat that will be sure to turn heads. Features · Material: bio-washed chino twill material · Sewn eyelet · Lightweight and comfortable · unstructured design', NULL, 28.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 14:07:39', '2025-03-27 14:01:28', NULL),
(41, 25, NULL, 'Red Bucket Hat | Sportman', 'red-bucket-hat-sportman', NULL, 'With its wide brim, this Royal bucket hat is the best choice for protecting you from the harsh sun and wind. It’s made of bio-washed chino twill material that makes it durable, fade-resistant, and able to withstand the outdoor environment. The custom bucket features sewn in eyelets that adds to its breathability. With its unstructured design, it can be easily folded for travel. It has a simple but classic look that can be matched with various casual wear and denim. Design your own by uploading your logo or text in our hat maker. Create a one-of-a-kind custom embroidered hat that will be sure to turn heads. Features · Material: bio-washed chino twill material · Sewn eyelet · Lightweight and comfortable · unstructured design', NULL, 28.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 14:11:06', '2025-03-27 14:01:47', NULL),
(49, 27, NULL, 'Retro 2 tone trucker hat | Yupoong', 'retro-2-tone-trucker-hat-yupoong', NULL, 'Bring the 90s back with this retro 2 tone Yupoong trucker hat. Featuring a classic contrast trucker mesh back and permacurv visor.', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 16:03:17', '2025-03-27 14:02:07', NULL),
(50, 30, NULL, 'Camo 9Fifty snapback | New Era', 'camo-9-Fifty-snapback-new-era', NULL, 'The Camo 9Fifty snapback from New Era is a must have streetwear accessory for all ages. It features a structured front panel, offering a high profile frame along with premium stability. To offer a flawless fit, the open back is equipped with a snap closure. Thanks to the pure cotton twill material, this one is your all-year-round companion. Now you can create a custom camo 9Fifty snapback for yourself, with the help of our very own custom hat maker. Use it to add your logo, graphics or text to create a personalized hat that makes you stand out.', NULL, 31.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 16:07:45', '2025-03-27 14:02:29', NULL),
(51, 27, NULL, 'Neon Snapback | Yupoong', 'neon-snapback- yupoong', NULL, 'The Neon snapback hat by Yupoong has a classic 6 panel design that features fan adjustable plastic strap on the back, a flat brim and a full crown profile. The button on the top of the hat is the same color as the hat itself, and so is the stitching. Materials: The Yupoong snapback is made from 80% Acrylic / 20% Wool. It has a bit of a heavier feel to the material, It breathes extremely well and is machine washable. Size & Fit: The Yupoong snapback is fully adjustable up to 24 ¼ inches, which means it fits most head sizes.', NULL, 30.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 16:15:45', '2025-03-27 14:03:25', NULL),
(52, 27, NULL, 'Classic trucker hat with white front panel | Yupoong', 'classic-trucker-hat-with-white-front-panel -yupoong', NULL, 'The Classic trucker hat from Yupoong features a structured white front panel that is made from a 65/35 Polyester-Cotton blend material. It\'s large crown height (3.5 inches) gives it a large surface area making it a great hat for customization. It has a flat brim that can be manually curved and a snapback enclosure giving it a one size fits all fit. The undervisor of the hat matches the color of the brim.', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 16:26:27', '2025-03-27 14:04:01', NULL),
(53, 27, NULL, 'Melton Wool snapback | Yupoong', 'melton- wool- snapback- yupoong', NULL, 'The Melton Wool Snapback from Yupoong features a classic shape, identical to the Classic Snapback we offer. The key difference is the material as this snapback features a fresh and premium melton wool blend. Includes a matching plastic snap and six panel arrangement making it a perfect choice for your next custom hat. Other key features of this hat are the green under brim, white sweatband and the 7 position snap closure. The material composition is 50% wool, 30% acrylic and 20% nylon.', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 16:31:01', '2025-03-27 14:04:23', NULL),
(54, 27, NULL, 'Poplin golf snapback | Yupoong', 'poplin-golf-snapback- yupoong', NULL, 'The Yupoong poplin golf snapback sports 4 rows of stitching on the visor and a 60% cotton and 40% polyester blend material. The unique look features a ¼” thick braid on the visor along with a classic five panels. The front panel has no seams, making it a smooth surface for custom embroidery. This tone-on-tone snapback is a CapBeast favorite for it\'s retro styling and customization potential.', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 16:41:26', '2025-03-27 14:04:42', NULL),
(55, 27, NULL, 'Melton Wool snapback | Yupoong', 'melton-wool-snapback-yupoong', NULL, 'The Melton Wool Snapback from Yupoong features a classic shape, identical to the Classic Snapback we offer. The key difference is the material as this snapback features a fresh and premium melton wool blend. Includes a matching plastic snap and six panel arrangement making it a perfect choice for your next custom hat. Other key features of this hat are the green under brim, white sweatband and the 7 position snap closure. The material composition is 50% wool, 30% acrylic and 20% nylon.', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 16:47:42', '2025-03-27 14:05:03', NULL),
(56, 27, NULL, '2 tone camo Snapback | Yupoong', '2-tone-camo-Snapback-yupoong', NULL, 'The Yupoong 2 tone camo hat offers a classic woodland camo style visor, paired with a monochromatic color scheme for the back. Ideal for style experimentation and featuring a premium wool blend.', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-24 16:54:09', '2025-03-27 14:05:23', NULL),
