(93, 30, NULL, 'Beanie hat | New Era', 'beanie-hat-new-era', NULL, 'A crazy cool and ultimately laid-back style, this is the epitome of all the good things in a well-made toque. The top starts out at a fine 1x1 knit rib then gradually increases towards the bottom to a 3x3 rib knit, adding just a subtle style point.', NULL, 31.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-25 12:40:05', '2025-03-25 12:40:05', NULL),
