(100, NULL, NULL, 'Hot pink/Black Low profile trucker hat | Richardson', 'hot- pink-black- low -profile- trucker- hat-richardson', NULL, 'Trucker hats should be about you and your personality. They should feel comfortable, and they should last long. The Richardson hat fits the bill perfectly and the hot pink and black shades come together to show your style. The Richardson low profile trucker hat is made from cotton and polyester for the utmost comfort. The 100% polyester mesh back offers proper circulation of heat and discourages sweat formation. It feels good on your head and fits even better. Features like structured, six-panel design and strapback closure make sure the hat stays on you even during hectic hours. We offer custom Richardson hats to our buyers. Just tell us your preferred logo or pattern and we\'ll have them embroidered on your custom trucker hat.', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-25 13:06:53', '2025-03-25 13:06:53', NULL);
