(250, 29, NULL, 'Cuffed Beanie | CapBeast', 'cuffed-beanie-capbeast', NULL, '<p>The custom cuffed knit beanie from CapBeast is made from premium-quality material and are 100% acrylic and comes in a variety of colors. The heather gray beanie is 62% acrylic and 38% polyester. The heather charcoal beanie is 80% polyester and 20% acrylic. Other heather colors of these beanie hats are 50% acrylic and 50% polyester. All these winter hats are highly flexible, soft, warm, and comfortable to wear. Moreover, these beanie hats match well with every outfit in your wardrobe. Use the CapBeast custom hat maker to design a beanie that is completely personalized and custom embroidered to your specifications. Key Features: Material: 100% Acrylic Colors: Black, Orange, Brown, Camel, Heather Charcoal, Heather Gray, and more Heather Grey is 62/38 acrylic/ polyester Heather Charcoal is 80/20 polyester/ acrylic Other Heather colors are 50/50 acrylic/ polyester Style: Cap with 12\" knit Adjustable cuff</p>', NULL, 14.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-27 16:04:05', '2025-03-27 16:04:05', NULL),
(256, NULL, NULL, 'White MVP hat | \'47 Brand', 'white-mvp-hat-47-brand', NULL, '<p>Whether you are a baseball player or want to design a custom baseball hat for your own team, ‘47 brand MVP hats are a perfect choice. This classic white hat is not only best for baseball players but can be worn on the streets by anyone. This ‘47 MVP hat in white color looks so stylish and tidy to wear. It is made of wool blend material and is comfortable to wear every day. There is a brand logo on the left side, making it a stylish hat for fashion aficionados. The MVP hat is ‘one size fits all, which means that it has an adjustable velcro back strap to give you a comfortable fit for sizes ranging from 6 ⅞\" to 7 ⅝\". You can increase or decrease the closure\'s length for the desired fit. The best thing about designing your own hat is that you can have your logo or text custom embroidered using our baseball hat maker. Key Features Material: 15% wool and 85% acrylic Color: White Style: Baseball hat Size: Fit sizes to all Adjustable velcro back strap Curved bill Hand wash only</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-28 09:09:09', '2025-03-28 09:09:09', NULL),
(257, NULL, NULL, 'Red MVP hat | \'47 Brand', 'red-mvp-hat-47-brand', NULL, '<p>If you are looking to design a custom baseball hat, the red MVP hat is for you. The MVP can be worn with any ensemble. With a unique style and construction, this red-colored embroidered cap makes the ultimate everyday hat. The ‘47 Brand MVP hats are is made of high-quality woolen blend material and are very comfortable to wear. An easy-to-use adjustable strap on the back allows you to increase or decrease the size of the hat for a secure fit. You can adjust the sizes between 6 ⅞\" and 7 ⅝\". Moreover, the structured crown and curved visor make this cap more stylish and perfect for any wardrobe. Make custom embroidered caps using our hat maker tool. Key Features Fabric: 15% wool and 85% acrylic Fit: Structured Style: Adjustable strap Color: Red One size fits all Hand wash only</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-28 09:12:08', '2025-03-28 09:12:08', NULL),
(258, NULL, NULL, 'Navy MVP hat | \'47 Brand', 'navy-mvp-hat-47-brand', NULL, '<p>When you are in search of a high-quality yet comfortable baseball hat, \'47 Brand MVP is a great option. This navy-colored custom baseball hat is very comfortable to wear while playing, practicing, or watching the game. You can also wear it every day with any outfit to look good and fashionable. The 47 Brand MVP is made out of wool and acrylic material which is soft to feel and touch. Also, the hat features a 47 Brand ogo on the left side, which makes it a more unique and aesthetic baseball cap. And, if you\'re searching for custom baseball hats, this \'47 Brand MVP makes a perfect choice for your company logo. Upload your design using our hat maker and create the perfect design for you. Key Features: Material: 15% wool and 85% acrylic Color: Navy Style: Hat Size: One size fits all Hand washable only</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-28 09:15:08', '2025-03-28 09:15:08', NULL),
