(261, NULL, NULL, 'Red Athletic Hat | Adidas', 'red-athletic-hat-adidas', NULL, '<p>With its top-quality construction and double stitching, the Red Adidas athletic custom hat is the perfect summer accessory for any ensemble. With an unstructured six panel frame and low profile construction, this hat is perfect for Golf, baseball or even working out at the gym. The front features a a pre-curved visor made from a high-quality cotton material to shield you from the sun. It has a breathable mesh panel that ensures maximum ventilation in the summer heat. The back of the custom dad hat is a snapback closure for a custom fit. Design your own using our hat creator tool. You can embroider your own logo or text to make a hat that is unique to you. Features • Brushed cotton twill • Precurved visor • Adidas flip buckle and grommet • Embroidered Adidas logo on the side</p><p><br>&nbsp;</p>', NULL, 36.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-28 09:26:07', '2025-03-28 09:26:07', NULL),
