(267, NULL, NULL, 'Multi Cam Classic Snapback | Yupoong', 'multi-cam-classic-snapback-yupoong', NULL, '<p>This custom baseball hat is made for the outdoor enthusiast who loves a minimalistic and subtle design. Made of cotton and spandex material, it\'s comfortable and has moisture-wicking properties. The hat features a snapback closure that makes it one size fits all. It has a high profile which makes it perfect for customization and the snapback closure makes it one size fits all. The hat has a flat brim that makes it trendy and stylish. It has a green under-visor that offers excellent protection from the sun\'s rays. At the back is a mesh material that ensures breathability. It has a sewn eyelet that helps to keep you cool in the summer heat. This customized hat is a must-have accessory for those who love the outdoors on hot days. You can create a custom baseball hat by adding your favorite logo or print on the front panel. You can do that using our CapBeast hat maker tool. Features • Made of 98% cotton and 2% spandex • High profile hat • Flat visor with green undervisor • Sewn eyelet</p><p><br>&nbsp;</p>', NULL, 27.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-28 10:38:24', '2025-03-28 10:38:24', NULL),
(268, NULL, NULL, 'MultiCam Light Green Dad Hat | Yupoong', 'multicam-light-green-dad-hat-yupoong', NULL, '<p>The Yupoong Multicam Light Green custom dad hat has all the functionality needed for outdoor activities. It\'s breathable and moisture-wicking making it perfect for casual wear, hunting, fishing, running, etc. Made of cotton and spandex, it\'s comfortable, durable and feels good on the skin. It has a flat visor which maximizes protection from sunlight. It also features a black under-visor. The personalized hat has embroidery on the visor that adds to its stylish look. It has a snapback closure at the back to ensure a custom fit. The custom dad hat has a light green color that makes it perfect for the outdoors. Design your own custom hat by using our hat maker tool. Upload your own logo or design and we\'ll embroider it on the hat. Features • Made of cotton and spandex material • Flat visor • Black under-visor • Sewn eyelets</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-28 10:44:21', '2025-03-28 10:44:21', NULL),
