(316, NULL, NULL, 'White-Royal Lite R-Flex U-Form fitted baseball hat | Richardson', 'white-royal-lite-r-flex-u-form-fitted-baseball-hat-richardson', NULL, '<p>The White-Royal Lite R-Flex U-Form fitted baseball hat from Richardson is the perfect choice for athletes who demand the best in performance and style. The hat\'s sleek design features a curved visor that can be flexed to a flat position, and laser-vented back panels that allow for maximum breathability and comfort. And thanks to R-Active technology, this hat is guaranteed to keep you cool and dry all game long.With its large white canvas on the crown, you can easily add your logo or text with stark colors using CapBeast’s custom hat maker.</p><p><br>&nbsp;</p>', NULL, 37.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-28 15:05:23', '2025-03-28 15:05:23', NULL),
