(418, NULL, NULL, 'Fitted cotton hat | New Era', 'fitted-cotton-hat-new-era', NULL, '<p>Made with breathable cotton and Spandex, the Fitted Cotton hats from New Era are designed for maximum comfort. These structured mid-profile hats feature a stretchable fit, making them suitable for a greater number of people. The premium built of this 6-panel cotton cap ensures durability, and the simple design makes it a versatile piece of accessory. These are available in a wide range of classic colors, so the options are endless. At CapBeast, we customize fitted New Era hats and add a personalized touch to them. Insert your choice of text and graphics into the interface, and we will embroider it onto your cap. Your custom fitted New Era is just a click away– place your order today.</p><p><br>&nbsp;</p>', NULL, 32.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 13:28:35', '2025-03-29 13:28:35', NULL),
(419, NULL, NULL, 'Mid profile baseball hat | \'47 Brand', 'mid-profile-baseball-hat-47-brand', NULL, '<p>The Mid Profile Baseball hats from \'47 Brand represent a blend of classic design and a touch of minimalism. These simple caps exude a sporty vibe, making them an essential accessory in every hat-lover\'s collection. Crafted with a premium wool blend, they come with fabric straps at the back. You get comfort, and durability and an adjustable fit rolled up in the same hat. A wide range of color options are available, so you are free to pick your favorite. And in case you want to personalize these 47 Brand hats, CapBeast can help in achieving that. We will embroider your logo and text on the cap to make your squad stand out.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 13:59:11', '2025-03-29 13:59:11', NULL),
(420, NULL, NULL, 'Flat bill 9Fifty snapback | New Era', 'flat-bill-9fifty-snapback-new-era', NULL, '<p>This New Era 6-panel cap highlights all that was good back in the day. The old-school snapback closure and iconic flat bill adds that subtle charm to take you back. With a flat bill and a large front panel, the 9Fifty is a great choice for customization. The larger front panel means you can add logos up to 2.75\" in height. The 9Fifty is constructed from 100% cotton, and the under brim matches the color of the outer portion of the hat. The snapback has 7 positions for adjusting the fit.</p><p><br>&nbsp;</p>', NULL, 31.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 14:10:30', '2025-03-29 14:10:30', NULL),
(421, NULL, NULL, 'Pulse R-Flex fitted baseball hat | Richardson', 'pulse-r-flex-fitted-baseball-hat-richardson', NULL, '<p>This bad boy is made with 98/2 polyester/spandex and has a mid-profile, six-panel construction. But that\'s not all! It also features Performance stretch, U-form technology (so you can flex the visor from a curved to a flat position at all times), Pulse fabric, R-Active technology, and a StayDri Performance stretch sweatband. Its wide two-panel front on the crown makes it ideal for large embroidery logos. Basically, it\'s the perfect hat for anyone who wants to look good and feel comfortable while they\'re doing it. Create your own custom Richardson Pulse R-Flex CapBeast by adding your logo, text, or graphics using CapBeast\'s custom hat maker.</p><p><br>&nbsp;</p>', NULL, 35.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 14:31:50', '2025-03-29 14:31:50', NULL),
(422, NULL, NULL, 'Cotton Blend Cap | Flexfit', 'cotton-blend-cap-flexfit', NULL, '<p>No matter if it’s the big game or an important company event; this combed twill cap will fit into any occasion you may find yourself in. The mid-crown profile on this fitted cap, along with the 6-panel design allows a comfortable and relaxed fit. The added feature of the fused hard buckram sewn into the front of the crown ensures the structure of the hat stays, wear after wear.</p><p><br>&nbsp;</p>', NULL, 32.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 14:56:04', '2025-03-29 14:56:04', NULL),
(423, NULL, NULL, 'Mesh stretch fitted hat | New Era', 'mesh-stretch-fitted-hat-new-era', NULL, '<p>Where there’s a game to be played, you’re in it. Where there’s an empty field, you’re on it. Take that attitude and be ready for anything in this active-style cap with Spacer Mesh on the mid and back panels. Stay cool and as always, stay ready.</p><p><br>&nbsp;</p>', NULL, 32.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 15:41:30', '2025-03-29 15:41:30', NULL),
(424, NULL, NULL, 'Lite R-Flex U-Form fitted baseball hat | Richardson', 'lite-r-flex-u-form-fitted-baseball-hat-richardson', NULL, '<p>Looking for a hat that will flex with your style? Look no further than the Lite R-Flex U-Form fitted baseball hat from Richardson. This hat is made with a high-tech 98/2 polyester/spandex blend and features a mid-profile, six-panel design. The best part? The U-form technology allows you to flex the visor from a curved to a flat position at all times. Plus, the Pulse fabric and R-Active technology help keep you cool and dry while you\'re on the go. The StayDri Performance stretch sweatband ensures a comfortable fit, while the two size options (S/M or L/XL) make it easy to find the perfect fit for your head. Create your own custom Richardson baseball cap by adding your logo, text, or graphics using CapBeast’s design interface.</p><p><br>&nbsp;</p>', NULL, 37.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 16:06:01', '2025-03-29 16:06:01', NULL),
(425, NULL, NULL, 'Ultrafiber Airmesh hat | Flexfit', 'ultrafiber-airmesh-hat-flexfit', NULL, '<p>Grab on to what’s hot in the hat world with this sporty cap! The Airmesh on the back and side panels are great for a cool head in the hot sun, the blended fabric allows for ease of movement and flexability, and the Permacurv visor shields your eyes from elements.</p><p><br>&nbsp;</p>', NULL, 32.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 16:24:12', '2025-03-29 16:24:12', NULL),
(426, NULL, NULL, 'Performance Cap | Adidas', 'performance-cap-adidas', NULL, '<p>For the ones who grind hard on the field everyday, Adidas athletic caps are the ideal accessories. Designed from recycled polyester, the Adidas Performance Caps feature the brand logo on the side. Created for optimum protection, the caps come with UPF 50. Available in a wide range of colors, these sports hats are equipped with hook and loop closure, along with a structured, mid-profile design. They fit your head smoothly, ensuring comfort and convenience. If you want to add a personal touch to the cap, CapBeast is here to create a custom Adidas hat for you. The athletic hat will carry a customized embroidered logo and graphics of your choice.</p><p><br>&nbsp;</p>', NULL, 39.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 16:45:09', '2025-03-29 16:45:09', NULL),
(427, NULL, NULL, 'Athletic Hat | Adidas', 'athletic-hat-adidas', NULL, '<p>The Adidas Athletic custom hat features a sturdily-made cotton exterior and an interior sweatband that wicks away sweat and keeps you cool in the summer heat. It has a pre-curved brim that shields you from the sun. At the back of the cap is a classic strapback that ensures a custom fit. The side of the hat features an Adidas logo that keeps you stylish and guarantees the authenticity of your hat. The athletic wear hat has a breathable mesh panel at the back that keeps you cool. Design your own hat using the CapBeast custom hat maker. It allows you to upload your own logo or text to make a one of kind Adidas hat. Features • Cotton material • Precurved brim • Adidas logo on the side • Breathable mesh panel • Snapback closure</p><p><br>&nbsp;</p>', NULL, 36.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 17:02:01', '2025-03-29 17:02:01', NULL),
(428, NULL, NULL, 'Wool blend cap | Flexfit', 'wool-blend-cap-flexfit', NULL, '<p>This is the classic athletic cap, meant for anyone who knows what’s right for the game. It’s meant to be worn, worn by a player, a doer, an athlete. No need to worry about this cap, it can handle any game that’s thrown at it. This fitted cap has a curved bill with silver under visor and a 6-panel design with sewn eyelets.</p><p><br>&nbsp;</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 17:12:39', '2025-03-29 17:12:39', NULL),
(429, NULL, NULL, 'Clean up cap | \'47 Brand', 'clean-up-cap-47-brand', NULL, '<p>Show off your team spirit with this signature style 47 Clean up hat. This custom baseball hatcap is garment-washed to give a soft \"broken-in\" look and feel without losing the color and brightness in the logo. The curved bill and adjustable headband assure a perfect and comfortable fit all day and all night. High-quality raised embroidered \'47 brand logo on the side amps up your style statement. So, these customized hats are a time-tested favorite of sports fans and even players around the world. If you’re looking for custom baseball hats, this dad cap style provides enough space for customization options, like brand name, logo, or other icons. Key Features: Material: 100% cotton twill Fit: Unstructured, relaxed Style: Adjustable back strap closure Bill: Curved Garment-washed for softer look &amp; feel One size fits all Available colors: Khaki, vintage navy, dark green, maroon, Columbia blue, rose, natural, charcoal, black, white, navy, royal, red, orange</p><p>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 17:42:25', '2025-03-29 17:42:25', NULL),
(430, NULL, NULL, 'Classic snapback | Yupoong', 'classic-snapback-yupoong', NULL, '<p>The Classic Snapback for Yupoong is more than your average hat. Featuring the iconic snapback closure, high profile and vintage six panel design; this is the perfect candidate for you to express your very own personal design with CapBeast’s hat customizer tool. This quality snapback consistently wins our customer polls for their favorite based on its impeccable construction and materials. The wool blend is durable and the adjustable snapback has 7 positions for a perfect fit. To top it off, the classic snapback from Yupoong features a green under brim.</p><p><br>&nbsp;</p>', NULL, 32.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 19:54:59', '2025-03-29 19:54:59', NULL),
(431, NULL, NULL, 'Wool blend flat bill snapback | Flexfit', 'wool-blend-flat-bill-snapback-flexfit', NULL, '<p>Amplify your style with this retro-inspired wool blend hat from Flexfit. The Flexfit snapback has a personality that only heightens your own style. This is a high-profile hat, meaning the front panels are taller than most other hats giving you more room for your designs and logos. The snapback closure and flat bill are reminiscent of a time when the days were good and style was a pastime. This cap is available in either two-tone or solid colours, with a tone-on-tone under brim. Customize this snapback by uploading your logo or adding your text and we\'ll embroider it using the latest digital machines.</p><p><br>&nbsp;</p>', NULL, 31.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 22:56:37', '2025-03-29 22:56:37', NULL),
(432, NULL, NULL, 'Strapback structured cap | New Era', 'strapback-structured-cap-new-era', NULL, '<p>Made with 100% cotton twill, the New Era Strapback Structured Caps are versatile accessories suitable for people of all ages. This adjustable cap features a hook and loop closure, ensuring a perfect fit. The 6-panel strapback is available in a wide range of classic colors, including graphite, deep navy, black, white, royal, khaki, and scarlet. With the help of CapBeast, now you can create a custom strapback hat, and add a personalized logo or text to it. Tell us what you have in mind, and we would get it embroidered onto the cap. With our premium embroidery, your favorite strapback would look cooler than ever. So, are you ready to sport a unique custom New Era hat?</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 23:36:45', '2025-03-29 23:36:45', NULL),
(433, NULL, NULL, 'Cotton strapback hat | CapBeast', 'cotton-strapback-hat-capbeast', NULL, '<p>With CapBeast, create a custom hat that allows you to be at your productive best. Here we have a wide range of Cotton Strapback Hats, available in a host of colors. Made with 100% cotton twill, the caps don\'t lose their shape even when you use them for a long time. They come with adjustable velcro straps for more convenience. Classic structured hats like these never go out of style, thanks to the comfort they have to offer. Now, to make these simple caps a lot more interesting, you can choose to add embroidered text and get it customized. So it\'s time to put on a custom hat from the house of CapBeast, today.</p><p><br>&nbsp;</p>', NULL, 32.80, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-03-29 23:57:58', '2025-03-29 23:57:58', NULL),
(434, NULL, NULL, 'Trucker hat | CapBeast', 'trucker-hat-capbeast', NULL, '<p>If you’re in the market for that now-iconic trucker hat look, you’ve got it right here. This cap honors what we all know and love about the original trucker cap. Combine the foam front, mesh side and back, and double plastic tab adjust to make one heck of a hat you’ll have a hard time not wearing every day.</p><p><br>&nbsp;</p>', NULL, 52.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 11:44:22', '2025-04-03 11:44:22', NULL),
(435, NULL, NULL, 'Trucker hat | New Era', 'trucker-hat-new-era', NULL, '<p>Featuring a front panel made of 100% cotton twill and a mesh back, the 5-panel New Era Trucker Hat carries a convenient snapback closure for better adjustability. The mid and back panels are made with pure polyester mesh, designed for superior ventilation even during the hottest times of the year. Thanks to CapBeast, creating a custom trucker hat has become easier than ever. Just add your logo and text on our interface, and we will get it embroidered on your New Era Hat. Available in a wide array of classic colors, this is one of our top choices for a custom New Era hat.</p><p><br>&nbsp;</p>', NULL, 36.40, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 12:02:38', '2025-04-03 12:02:38', NULL),
(436, NULL, NULL, 'Retro trucker hat | Yupoong', 'retro-trucker-hat-yupoong', NULL, '<p>When it comes to trucker hats, this offering from Yupoong is a CapBeast favorite. Complete your vintage style with this Yupoong retro trucker hat, with a mesh back and curved visor complete with eight rows of stitching. The front panels are made of a 65% Cotton / 35% Polyester blend, with a matching under brim. At the back, you\'ll find the classic snapback closure to adjust to the fit. The mid-profile means that this hat can accommodate logos up to 2.5\" in height. We embroider your logos directly onto the hat using the latest technology.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 12:21:42', '2025-04-03 12:21:42', NULL),
(437, NULL, NULL, 'Trucker hat | \'47 Brand', 'trucker-hat-47-brand', NULL, '<p>The \'47 Brand Trucker Hat is an excellent choice of cap, featuring a strapback design. The unique design is what sets it apart from the sea of caps out there. Available in a plethora of colors, these premium 100% washed-cotton caps are not just awesome to look at but are also comfortable for daily wear. The curved, unstructured design ensures a relaxed fit, so you can put these on all throughout the year. These strapback hats are now easy to customize, thanks to CapBeast. Add a text, logo, or graphics that you like, and we would beautifully embroider it onto the cap. So are you ready to own a custom trucker hat? Personalize it right away.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 13:59:43', '2025-04-03 13:59:43', NULL),
(440, NULL, NULL, '112 Trucker hat | Richardson', '112-trucker-hat-richardson', NULL, '<p>A leading name in the hat industry, Richardson has been committed to creating superior quality headwear for over 50 years now. The Richardson 112 trucker hats feature a 100% polyester mesh back, and a structured 5-panel design. Made of 60/40 cotton polyester blend, the mid-profile Richardson trucker hats are high on comfort. Thanks to the adjustable plastic snapback, they offer a good fitting for almost everyone. When it comes to headwear, personalization is the way to go. To create a custom Richardson 112 hat for yourself, add your logo, graphics, and text to our design interface, and our team will have it embroidered on your choice of cap. Available in a wide range of colors, these custom Richardson hats are versatile and suitable for all ages.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 15:11:07', '2025-04-03 15:11:07', NULL),
(441, NULL, NULL, 'Black Seven panel trucker hat | Richardson', 'black-seven-panel-trucker-hat-richardson', NULL, '<p>The classic Black Richardson Seven panel trucker hat is made of cotton, nylon, and polyester, with the backside featuring a mesh design made of pure polyester. This high-profile, structured Richardson hat has been designed for everyday use, ensuring utmost comfort every time you put this on. This convenient headwear features a snapback design, ensuring a seamless fit. Want to sport custom Richardson hats? CapBeast is here to help. Input your choice of text, logo, graphics, etc. to our user interface, and allow us to embroider them into your hat. With us, you are just a few clicks away from owning a custom trucker hat. Place an order with CapBeast, today.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 15:27:58', '2025-04-03 15:27:58', NULL),
(442, NULL, NULL, 'Seven panel trucker hat | Richardson', 'seven-panel-trucker-hat-richardson', NULL, '<p>CapBeast presents to you a large collection of Richardson seven-panel trucker hats. Featuring a mesh design at the back and a blended material on the front, this hat is a versatile choice for all seasons. Available in a wide number of color combinations, these high-profile Richardson hats come with a flat bill and a structured design. Owing to the snapback closure, it can fit perfectly for most people. Here at CapBeast, we embroider your choice of text, logo, graphics, etc. on top of the cap to give it a personalized touch. With us, you can create custom Richardson hats in just a matter of a few clicks. Take a look at our entire range, and place an order for a custom trucker hat.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 15:39:15', '2025-04-03 15:39:15', NULL),
(443, NULL, NULL, 'Black Trucker hat | \'47 Brand', 'black-trucker-hat-47-brand', NULL, '<p>The \'47 Brand\'s Black Trucker Hat is the epitome of sophistication. It\'s simple, stylish, and ensures that your comfort doesn\'t have to be compromised. The 100% washed-cotton renders a soft touch to this cap, and the strapback design leads way to a good fit. The relaxed and curved bill design makes this cap a favorite for every season. If you want to personalize this cap to sport a unique look, CapBeast is here to help. Let us know the text and logo that you’d like to add to it, and we will embroider it for you. With a 100% guarantee of premium quality, your custom 47 brand trucker hat is just a few clicks away.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 15:52:14', '2025-04-03 15:52:14', NULL),
(444, NULL, NULL, 'Faded Trucker Hat | Sportman', 'faded-trucker-hat-sportman', NULL, '<p>This faded trucker hat has the right distinct colors and style to match your individuality. It’s made of a cotton and polyester blend that makes it comfortable, stretchable, and soft. The Sportsman trucker hat has an unstructured construction that makes it packable and portable. It has a simple design and solid colors that will match different clothing styles and matching different moods. The custom Sportsman hat is made with a superior stitching technology that makes it sturdily made and tear-resistant. It has a pre-curved visor that will protect you from wind and sunshine. This custom trucker hat is a size fit for all. With the adjustable buckle closure at the back, you can adjust the cap to fit your head\'s size. Create a custom trucker hat using our hat maker tool. Simply upload your logo or text and let the tool embroider it on your hat. Feature · Material: 55% cotton and 45% polyester · Adjustable fit · Sewn eyelets · Pre-curved visor · No minimums · Customized</p><p><br>&nbsp;</p>', NULL, 28.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 16:07:34', '2025-04-03 16:07:34', NULL),
(445, NULL, NULL, 'Dirty-wash mesh hat | CapBeast', 'dirty-wash-mesh-hat-capbeast', NULL, '<p>Who needs to be cleaned-pressed all the time? We’re all allowed to have those moments when casual and comfortable are at the forefront of our minds. With this dirty-washed mesh cap, you can achieve that deliberately disheveled look easily. Unstructured and perfectly worn-in, this is the hat for your everyday. Back is a glide buckle closure.</p><p><br>&nbsp;</p>', NULL, 28.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 16:26:09', '2025-04-03 16:26:09', NULL),
(446, NULL, NULL, 'Black & white 112 Trucker hat | Richardson', 'black-white-112-trucker-hat-richardson', NULL, '<p>Available in the unbeatable combination of black and white, this Richardson 112 trucker hat takes comfort and versatility to the next level. As the maker of premium hats for over five decades, Richardson promises great quality and a superior fit. Made of a 60/40 blend of cotton and polyester, this hat features a 100% polyester mesh back. This mid-profile Richardson hat comes with a 5-panel structured design and an adjustable snapback for comfortable fitting. If you want to own custom Richardson 112 hats with your personal logo and texts embossed on top, CapBeast can help you out. Insert your choice of graphics into our design interface, and we would have them embroidered on your hat.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 16:28:59', '2025-04-03 16:28:59', NULL),
(447, NULL, NULL, 'Graphite & Black Trucker hat | New Era', 'graphite-black-trucker-hat-new-era', NULL, '<p>Want to sport a custom trucker hat this summer? Take a look at the Graphite and Black Trucker Hat from New Era– it is versatile, comfortable, and can be customized as per your request. This New Era hat comes with an adjustable snapback closure so that it can fit well on your head. The front panel is made of 100% cotton twill while the mid and back panels are made of a polyester mesh, and allow better airflow. Available in a classic color combination, this 5-panel hat is a simple yet useful accessory, suitable for people of all ages. Now if you want to create your own custom New Era hat, all you have to do is upload a logo on our interface. CapBeast would turn it into embroidery, and present you with your custom trucker hat bearing your personalized logo.</p><p><br>&nbsp;</p>', NULL, 36.40, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-03 16:35:37', '2025-04-03 16:35:37', NULL),
(448, NULL, NULL, 'Graphite & Cyber Green Mesh stretch fitted hat | New Era', 'graphite-cyber-green-mesh-stretch-fitted-hat-new-era', NULL, '<p>This mid-profile stretch-fitted hat from New Era comes in a combination of graphite and cyber green, featuring the brand logo on the visor. Designed for year-round comfort, the front panel has been made of pure cotton twill. The mid and back panel is made of textured polyester Spacer mesh, while the inner seams of the cap carry the New Era taping. Thanks to the elasticized band, it offers a stretchable fit. The 6-panel structured design gives the cap a neat look and allows it to stay in shape for the longest time. If you want to create a custom hat, you can add personalized text or graphics to it.</p><p><br>&nbsp;</p>', NULL, 32.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 08:29:42', '2025-04-04 08:29:42', NULL),
(449, NULL, NULL, 'Black & White Mesh stretch fitted hat | New Era', 'black-white-mesh-stretch-fitted-hat-new-era', NULL, '<p>The Black &amp; White Mesh stretch fitted hat from New Era makes sure you stay nice and comfortable the whole day wearing it. The mid and back panels of the custom fitted hat are made of 100% polyester Spacer mesh which is the ideal material to balance between comfort, ruggedness, and moisture-wicking properties. It\'s a fitted, structured cap that features cotton twill on the front panel. The two-tone design goes well with numerous occasions and the elasticized band takes care of the fit. The New Era personalized hats allow you to carry your personality in your outfits. Just add your favorite graphics or text for a custom embroidered hat.</p><p><br>&nbsp;</p>', NULL, 32.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 08:31:51', '2025-04-04 08:31:51', NULL),
(450, NULL, NULL, 'Deep Navy Mesh stretch fitted hat | New Era', 'deep-navy-mesh-stretch-fitted-hat-new-era', NULL, '<p>The Deep Navy Mesh stretch fitted hat from New Era exudes the timeless charm of New Era hats and blends the style of mesh hats. Made from 100% polyester Spacer mesh, the custom baseball hat which provides superior comfort in the heat. The front panel of the hat is made of 100% cotton twill to soften out the impact of the sun’s rays. It\'s a mid-profile, structured hat with a 6-panel design that looks refreshingly modern. The elasticized band at the back means that it’s also custom fitted and ensures that this hat is a great fit for everyone. The New Era hats can be tweaked to fit individual preferences. To flaunt custom embroidered hats, all you have to do is add your favorite text, logo, and graphics using our hat maker.</p><p><br>&nbsp;</p>', NULL, 32.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 08:34:16', '2025-04-04 08:34:16', NULL),
(451, NULL, NULL, 'Athletic mesh hat | Flexfit', 'athletic-mesh-hat-flexfit', NULL, '<p>The Flexfit athletic mesh hat encompasses an authentic athletic look and feel. The cap features polyester mesh throughout the crown with a lightweight feel for comfort.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 08:39:44', '2025-04-04 08:39:44', NULL),
(452, NULL, NULL, 'Glen check hat | Flexfit', 'glen-check-hat-flexfit', NULL, '<p>Add some high fashion style to your headwear collection with this Flexfit glen check hat. Featuring a self-colored undervisor and glen check patterned fabric.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 08:52:57', '2025-04-04 08:52:57', NULL),
(453, NULL, NULL, 'Pinstripe hat | Flexfit', 'pinstripe-hat-flexfit', NULL, '<p>Create a custom embroidered Flexfit hat with a throwback feel. This Flexfit pinstripe hat has 6 panels and a permacurv visor, complete with a stylish 50s pinstripe design.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 09:01:54', '2025-04-04 09:01:54', NULL),
(454, NULL, NULL, 'Mesh back hat | Flexfit', 'mesh-back-hat-flexfit', NULL, '<p>When the game is the most important thing on your plate, there isn’t time to worry about anything else. This Flexfit mesh back cap will keep your head cool, your eyes shielded from the sun with its silver undervisor to reflect light, and you looking good with the color-blocked front panel and visor. No worries, no problem…now focus on the game!</p><p><br>&nbsp;</p>', NULL, 30.40, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 09:12:56', '2025-04-04 09:12:56', NULL),
(455, NULL, NULL, 'Two-tone Piped Fitted Athletic Hat | New Era', 'two-tone-piped-fitted-athletic-hat-new-era', NULL, '<p>Two-tone Piped Fitted Athletic Hat from New Era is made for people who love to sweat it out in the field. The baseball hats have a bold blend of tones that render them a unique look. The New Era caps are breathable and don\'t allow sweat to settle. The panels and top of the brim have 100% polyester double mesh for superior air circulation while the under brim, sides, and piping are made of 100% cotton twill for comfort. The 6-panel custom caps have elasticized bands for easy fit and have been worn by numerous baseball stars during their batting practice. Be your own hat maker and design a hat that carries your personality. Just add your favorite logo and texts to make custom New Era caps.</p><p><br>&nbsp;</p>', NULL, 28.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 09:49:20', '2025-04-04 09:49:20', NULL),
(456, NULL, NULL, 'Fitted mesh trucker hat | Richardson', 'fitted-mesh-trucker-hat-richardson', NULL, '<p>The Richardson fitted mesh custom trucker hat is made from 98% Polyester and 2% spandex material making it durable, lightweight, and wrinkle resistant. The hat has the traditional six-panel construction that enables it to maintain its shape even when not worn. It has a mid-profile that makes it great for custom embroidery. The interior of the cap is made of a fast-drying material that wicks away sweat and fights odor. The back and sides are made of a soft mesh fabric that keeps your head well aerated. The hat has a pre-curved visor that helps to protect you from the UV rays. Design your hat online by using the customizer tool. Upload your logo or text to make a one-of-a-kind hat for you or your business. Features · Made of polyester and spandex material · Structured design · Six-panel construction · Pre-curved visor · Mesh fabric sides · No minimums · Design your own</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 10:07:04', '2025-04-04 10:07:04', NULL),
(457, NULL, NULL, 'Strapback dad hat | Yupoong', 'strapback-dad-hat-yupoong', NULL, '<p>The strapback dad hat by Yupoong provides an extra low profile design and classy antique brass knuckle enclosure. The hat is unstructured for a classic and elegant look.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 12:53:01', '2025-04-04 12:53:01', NULL),
(458, NULL, NULL, 'Dad Hat | Nike', 'dad-hat-nike', NULL, '<p>The Nike dad hat is a convenient and durable accessory to spice up your everyday outfits. Made with 58% cotton and 42% polyester, the dad hat is ideal for people who work long hours under the sun. The six-panel, unstructured design of the hat gives it a relaxed, toned-down look. Thanks to its mid-profile crown, wearers with all kinds of head shapes will be able to enjoy it. The curved bill actively protects from the sun and the contrast under the bill prevents glare. The back of the hat houses adjustable self-fabric closure with buckle and the iconic swoosh logo. The custom dad hat comes in a wide range of colors, giving people the option to pick up personalized Nike hats for themselves.</p><p><br>&nbsp;</p>', NULL, 27.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 13:24:37', '2025-04-04 13:24:37', NULL),
(459, NULL, NULL, 'Dad Hat | \'47 Brand', 'dad-hat-47-brand', NULL, '<p>The Dad Hats from \'47 brand are statement accessories that can be worn by people across generations. The curved structure, soft-washed cotton material, and relaxed fit ensure comfort, no matter which season it is. The 47 brand dad hat features strapback detailing, giving it a classic appeal. Available in a wide range of your favorite colors, these caps can be personalized however you want. You can add an embroidered logo, graphic, or text of your choice to this cap, and turn it into an extension of yourself! So place an order for your custom dad hat today, and walk in style.</p><p><br>&nbsp;</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 13:38:16', '2025-04-04 13:38:16', NULL),
(460, NULL, NULL, 'Black Dad Hat | \'47 Brand', 'black-dad-hat-47-brand', NULL, '<p>The Black Dad Hat from the \'47 brand is a classic creation. No matter which season it is, you can never go wrong with a classic black cap crafted from washed cotton. With an unstructured, relaxed fit, the cap lets you carry out your everyday work comfortably. Thanks to the strapback design and the adjustable fabric strap, this cap is one-size-fits-all. With CapBeast by your side, now it\'s possible to customize the cap, just the way you like it. Let us know your choice of text, logo, or graphics, and we will imprint it on to the cap with the help of world-class embroidery. So if your wish to rock your custom 47 brand dad hat like a pro, place your order today.</p><p><br>&nbsp;</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 13:43:02', '2025-04-04 13:43:02', NULL),
(461, NULL, NULL, 'Dri-FIT Swoosh Dad Hat | Nike', 'dri-fit-swoosh-dad-hat-nike', NULL, '<p>The Swoosh Dad hat from Nike adds a new dimension to the everyday look. Made from 90% polyester and 10% spandex, the hat offers both durability and flexibility. The structured, mid-profile hat comes with a six-panel design that provides a contemporary look. Thanks to the breathable materials, the custom dad hat features improved moisture-wicking properties and the contrast under the bill makes sure the sun doesn\'t get the better of you. The embroidered swoosh logo on the left side of the bill rounds off the aesthetics of the hat while the adjustable hook and loop closure ensures a seamless fit. Personalize this hat by adding your favorite text or design using the CapBeast hat maker.</p><p><br>&nbsp;</p>', NULL, 37.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 13:48:09', '2025-04-04 13:48:09', NULL),
(462, NULL, NULL, 'Dad hat | Champion', 'dad-hat-champion', NULL, '<p>The Champion dad hat is a classic brushed cotton hat with a strapback enclosure. The Champion logo is emblazoned on the back of the hat, right next to the strap. This soft, unstructured hat is perfect for customization with embroidery. Create your own custom Champion dad hat at CapBeast by adding your logo, text or graphics using our design interface.</p><p><br>&nbsp;</p>', NULL, 32.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 13:53:35', '2025-04-04 13:53:35', NULL),
(463, NULL, NULL, 'Custom Dad Hat | Sportsman', 'custom-dad-hat-sportsman', NULL, '<p>This 100% cotton pigment dyed twill hat is unstructured and low-profile, with a pre-curved visor and tri-glide buckle closure. The unique dye and washing process used on this hat making it truly unique. And because the fabric is pigment-dyed, special care must be taken when cleaning. When adding a logo or text using the CapBeast custom hat maker, be assured that the embroidery will not fade in regular care or hand washing unless under the most extreme circumstances. So whether you\'re hitting the links or just chilling out, do it in style with the Sportsman Dad Hat from Custom Hats!</p><p><br>&nbsp;</p>', NULL, 26.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-04 14:19:35', '2025-04-04 14:19:35', NULL);
