(519, NULL, NULL, 'Dark khaki Dad Hat | Nike', 'dark-khaki-dad-hat-nike', NULL, '<p>The Nike dad hat available in dark khaki color is designed for all-year-round comfort. Owing to its versatile design, the strapback hat is well-suited for people of all age groups. It is made with 58% cotton and 42% polyester and features a contemporary six-panel design. The unstructured design makes it suitable for different head shapes and sizes, with the adjustable self-fabric closure with buckle ensuring a convenient fitting. This mid-profile hat comes with the iconic Nike logo at the back. You can make a custom embroidered Nike dad cap by adding a logo, quote, or graphics of your choice on top of the hat.</p><p><br>&nbsp;</p>', NULL, 27.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 13:45:19', '2025-04-05 13:45:19', NULL),
(520, NULL, NULL, 'Navy Dri-FIT Dad Hat | Nike', 'navy-dri-fit-dad-hat-nike', NULL, '<p>The Nike dad hat is a no-fuss everyday accessory that comes in the classic deep navy blue shade. Thanks to a blend of 58% cotton and 42% polyester, the custom hat provides a seamless and durable performance even in the harshest of weather. The six-panel, mid-profile hat offers a modern look. It has an unstructured design, making it a safe choice for all kinds of head shapes. The thoughtfully designed contrast under the bill reduces sun glare and protects your head from the extra heat. Thanks to the adjustable self-fabric closure with buckle, it’s very easy to securely fit the hat on the head. You can create a Nike dad hat by adding your preferred quotes, designs, and logos.</p><p><br>&nbsp;</p>', NULL, 27.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 13:47:54', '2025-04-05 13:47:54', NULL),
(521, NULL, NULL, 'Game Royal Dad Hat | Nike', 'game-royal-dad-hat-nike', NULL, '<p>If you\'re heading out for a game, a Nike dad hat can instantly improve your looks. The game royal dad hat from Nike is a bright and iconic hat that also doubles as everyday wear. The strapback is made of 58% cotton and 42% polyester. Cotton helps in keeping you comfortable even after prolonged usage and polyester increases the hat\'s moisture-wicking properties and durability. The mid-profile hat with a six-panel design comes with a refined contrast under the bill that reduces sun glare and the unstructured design easily adjusts to all kinds of head shapes. It also has a self-fabric closure with a buckle that enables you to securely carry the hat. You can make a Nike dad cap for yourself by adding your favorite logo, text, or design to the custom embroidered hat.</p><p><br>&nbsp;</p>', NULL, 27.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 13:52:57', '2025-04-05 13:52:57', NULL),
(522, NULL, NULL, 'Gym Red Dad Hat | Nike', 'gym-red-dad-hat-nike', NULL, '<p>The Nike dad hat in gym red color is a bright and bold headwear. Made with 58% cotton and 42% polyester, it has a perfect balance of comfort and durability. The hat is ideal for people who spend a good deal of time under the sun. Thanks to the six-panel design, this mid-profile hat has a contemporary look. The contrast under the bill on the front reduces sun glare while the adjustable self-fabric closure with buckle and the incoming swoosh logo round off the features at the back. A personalized Nike hat immediately gives a different look to daily outfits. You can get a custom dad hat by having your favorite logo or graphics embroidered on it.</p><p><br>&nbsp;</p>', NULL, 27.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 13:55:32', '2025-04-05 13:55:32', NULL),
(523, NULL, NULL, 'True White Dri-FIT Dad Hat | Nike', 'true-white-dri-fit-dad-hat-nike', NULL, '<p>The Nike dad hat in true white color is a unique headwear that you can wear all day long. This no-fuss custom hat is made with 58% cotton and 42% polyester, giving it an ideal balance between comfort and durability. The unstructured, mid-profile hat with a six-panel design is created as an everyday accessory. The contrast under the bill prevents sun glare and the polyester improves the moisture-wicking properties. The adjustable self-fabric closure with buckle ensures a secure fit and the swoosh logo at the back amplifies the hat\'s aesthetics. You can wear a personalized Nike hat by adding your favorite logo or pattern to the hat of your choice.</p><p><br>&nbsp;</p>', NULL, 27.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 14:03:17', '2025-04-05 14:03:17', NULL),
(524, NULL, NULL, 'Anthracite Dri-FIT Perforated Athletic Cap | Nike', 'anthracite-dri-fit-perforated-athletic-cap-nike', NULL, '<p>For people who lead an athletic lifestyle, a custom Nike hat is the ideal accessory. The Anthracite Dri-FIT perforated athletic cap from Nike offers a unique perforated design and unparalleled comfort. The custom Nike hat in anthracite shade is made of 100% Dri-FIT polyester. The material comes with moisture-wicking properties as it transfers sweat from the body to the surface of the fiber. The unstructured, six-panel design of this low-profile hat has been complemented by an adjustable hook and loop closure and iconic swoosh logos. You can make a custom embroidered hat by adding your favorite text, graphics, or design to the Nike hat in the CapBeast hat maker.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 14:06:51', '2025-04-05 14:06:51', NULL),
(525, NULL, NULL, 'Navy Dri-FIT Perforated Athletic Cap | Nike', 'navy-dri-fit-perforated-athletic-cap-nike', NULL, '<p>The navy blue Dri-FIT perforated athletic cap from Nike is made to keep up with your active lifestyle. Thanks to the Dri-FIT polyester, the hat has unmatched moisture-wicking properties. It quickly transfers the sweat from the body to the surface of the fabric, making it ideal for long hours under the sun. The unstructured, low-profile hat has a six-panel design that lends it a stylish look. In the front, the custom hat has contrast under the bill to prevent sun glare and the adjustable hook and loop closure at the back for a relaxed fit. Two iconic swoosh logos on the left side of the bill and center back carry the ever-familiar Nike aesthetics. Personalize this hat in our hat maker.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 14:09:16', '2025-04-05 14:09:16', NULL),
(526, NULL, NULL, 'White Golf Visor | Flexfit', 'white-golf-visor-flexfit', NULL, '<p>Available in the classic white color, the Flexfit Golf Visor is the ideal accessory for regular golfers. The moisture-management mini piquè fabric keeps sweat at bay and helps you stay cool even on hot and humid days. The perfect blend of 97% polyester and 3% spandex promises comfort, with the signature Permacurv® visor making sure your vision doesn\'t get obstructed by the sun. The visor hat comes with a D-ring hook and loop enclosure at the back, offering a perfect fit. The inner side of the hat is styled with the brand logo. This golf sun visor can be personalized to your liking by adding custom text and graphics using our hat maker tool.</p><p><br>&nbsp;</p>', NULL, 27.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 14:11:36', '2025-04-05 14:11:36', NULL),
(527, NULL, NULL, 'Black Golf Visor | Flexfit', 'black-golf-visor-flexfit', NULL, '<p>The Black Golf visor from Flexfit is designed to offer comfort under the sun. The visor has a universal design, making it ideal for men\'s and women\'s events. The visor is made from 97% polyester and 3% spandex, which lends it superior comfort and durability. The Permacurv® visor is known to hold its natural shape without becoming creased. Moisture-management mini piquè makes sure you stay nice and cool while the elasticized D-Ring hook-and-loop closure easily adjusts to all kinds of head shapes. You can turn the Flexfit visor into a personalized golf hat by adding your favorite logo and text on it.</p><p><br>&nbsp;</p>', NULL, 27.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 14:14:04', '2025-04-05 14:14:04', NULL),
(528, NULL, NULL, 'Black Dri-FIT Swoosh Dad Hat | Nike', 'black-dri-fit-swoosh-dad-hat-nike', NULL, '<p>The Black Swoosh Dad hat from Nike is the ideal accessory for everyday use. The understated presence of the hat is contrasted by a bold swoosh logo on the left side of the bill. The custom hat is made of 90% polyester and 10% spandex, giving it a perfect blend of durability and stretch. The structured hat gets a contemporary look thanks to the six-panel, mid-profile design. The hat has a superior breathability and moisture-wicking property while the adjustable hook and loop closure takes comfort a notch higher. Customize this hat by adding your favorite text and graphics using our hat maker tool.</p><p><br>&nbsp;</p>', NULL, 37.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 14:16:12', '2025-04-05 14:16:12', NULL);
