(529, NULL, NULL, 'Navy Dri-FIT Swoosh Dad Hat | Nike', 'navy-dri-fit-swoosh-dad-hat-nike', NULL, '<p>The Navy Swoosh Dad hat from Nike is an iconic headwear for people who love the outdoors. Made from 90% polyester and 10% spandex, the custom dad hat is durable and breathable. The six-panel design and bold swoosh logo on the left side of the bill increase the aesthetics of this structured, mid-profile hat. The bill has contrast under it that prevents excessive sun glare. The adjustable hook and loop closure at the back takes care of the fit. Use the CapBeast hat maker to personalize this hat and make it your own using personalized text or your own design.</p><p><br>&nbsp;</p>', NULL, 37.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 14:18:42', '2025-04-05 14:18:42', NULL),
(530, NULL, NULL, 'Navy and White Retro Golf Hat | Imperial', 'navy-and-white-retro-golf-hat-imperial', NULL, '<p>This Navy and White Retro Golf Hat feature the traditional golf style with a modern twist. It’s made from 97% polyester and 3% spandex material that makes it comfortable, lightweight, and breathable. This hat has a moisture-wicking sweatband that absorbs sweat while keeping your head cool. At the back of the cap is an adjustible snapback closure that allows you to customize the size to fit your head. The custom hat comes in Navy and white color. It features a five-panel construction and a mid-profile, with a pre-curved visor that works well in protecting you from harmful UV rays. The soft and woven fabric will provide the ultimate comfort when outdoors. Design your own hat using rh CapBeast Hatmaker. Upload your logo or text to create a one of a kind custom hat. Features · Made of polyester and spandex material · One-size fit · Sewn eyelets · Pre-curved visor · No minimums · Design your own</p><p><br>&nbsp;</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 0, '2025-04-05 14:47:29', '2025-04-17 04:23:32', NULL),
(531, NULL, NULL, 'White and Black Retro Golf Hat | Imperial', 'white-and-black-retro-golf-hat-imperial', NULL, '<p>This White and Black Retro Custom Golf Hat is made from a comfortable polyester and spandex blend that makes it the ultimate accessory for all your outdoor activities. With a structured five-panel construction and a mid-profile, this hat has a large design area to feature your custom embroidered logo. This modern take on the golf hat is one size fits all and features an adjustable plastic snapback closure at the back that enables you to change the size to fit your head. The hat features a pre-curved visor that offers ample for the forehead and face. The interior of the hat has a moisture-wicking sweatband to help keep you cool. Make your own golf hat using the CapBeast custom hat maker. Features · Made of 97% polyester and 3% spandex · Pre-curved visor · Sweatband · Five-panel construction · No minimums · Design your own</p><p><br>&nbsp;</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 0, '2025-04-05 14:50:06', '2025-04-17 04:23:34', NULL),
(532, NULL, NULL, 'White and Navy Retro Golf Hat | Imperial', 'white-and-navy-retro-golf-hat-imperial', NULL, '<p>This White and Navy Retro Golf Hat is made from a 97% polyester and 3% spandex blend making it comfortable, breathable, durable, and fast-drying. The interior of the personalized hat is made of a moisture-wicking material that will dry away sweat and fight bad odor. The hat has a pre-curved visor that offers great protection from the sun. At the back of the hat is an adjustable plastic buckle closure that enables you to adjust the size to fit your head. This hat is a good choice for use in outdoor activities. Design your own custom hat using the hat maker from CapBeast. Embroider your own design to make the custom golf hat of your dreams. Features · Material:97% polyester and 3% spandex · Pre-curved visor · Structured, mid-profile, five-panel construction · Interior sweatband · No minimums · Customize your own</p><p><br>&nbsp;</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 0, '2025-04-05 14:52:26', '2025-04-17 04:23:37', NULL),
(533, NULL, NULL, 'Performance Golf Hat | Oakley', 'performance-golf-hat-oakley', NULL, '<p>The Oakley performance golf hat is made from 100% polyester making it comfortable, lightweight, and breathable. The hat has an inner sweatband to help keep your head cool. It wicks away moisture, and has antimicrobial properties that limit odor. At the back of the hat is a hook and loop closure that enables you to adjust the size to fit your needs. With a six-panel construction, this hat has a classic shape. To enhance the breathability of your head, it comes with two sewn eyelets. The golf cap has a curved visor that protects from UV rays. You can create a custom Oakley hat using our Capbeast hatmaker tool. Simply upload your logo or text for a personalized golf cap. Features · Made of 100% polyester material · Six-panel construction · Curved visor · Hook &amp; loop closure · No minimums · Design your own</p><p><br>&nbsp;</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 14:59:13', '2025-04-05 14:59:13', NULL),
(534, NULL, NULL, 'White Performance Golf Hat | Oakley', 'white-performance-golf-hat-oakley', NULL, '<p>This White Performance Golf Hat is the perfect custom hat to wear on the golf course. Made of 100% polyester material, it’s durable, lightweight, and dries quickly. The stitching of the hat is engineered in a superior way providing you with a durable and tear-proof cap. It has a hook and loop closure at the back that makes it easy to adjust to your size. The crown of the hat has embroidered lines that provide it with a classic and sleek design. To add to its breathability, the Oakley golf hat has sewn eyelets that ensure ample aeration of your head. This athletic wear is not only designed for fashion but as the ultimate sun protection. The Capbeast hatmaker lets you allows you to create a custom cap by uploading your design or logo. Features · 100% polyester material · Sewn eyelets · Hook and loop closure · Curved visor · No minimums · Design your own</p><p><br>&nbsp;</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:02:32', '2025-04-05 15:02:32', NULL),
(535, NULL, NULL, 'Navy Performance Golf Hat | Oakley', 'navy-performance-golf-hat-oakley', NULL, '<p>Made from 100% cotton material, this Navy Performance Golf Hat will leave you feeling comfortable in any situation, whether it’s on the course or in a casual setting. The material is soft to touch, and lightweight so that it will not weigh you down when engaging in outdoor activities such as running, golfing, hiking, baseball, camping, and more. The personalized hat features a five-structure construction and a mid-profile that makes it a good choice for all head sizes. It has a hook and loop closure at the back that enables you to adjust it to fit your head’s size. The stitching of the custom hat is professionally done making it sturdy and durable. There are sewn eyelets that keep your head well aerated. The front of the hat features a curved visor, and a mid-profile that is great for customization. Design your own hat by using the CapBeast hat maker. It allows you to create a personalized golf hat by simply uploading your text or logo. Features · 100% polyester material · Curved visor · Hook &amp; loop closure · Six-panel construction · No minimums · Design your own</p><p><br>&nbsp;</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:04:04', '2025-04-05 15:04:04', NULL),
(536, NULL, NULL, 'Stone Gray Performance Golf Hat | Oakley', 'stone-gray-performance-golf-hat-oakley', NULL, '<p>This Stone Gray Performance Golf Hat is a stylish and highly functional hat that is your perfect outdoor companion. Made of 100% polyester material, it\'s lightweight, breathable, and fast-drying. The custom Oakley hats feature a moisture-wicking sweatband that will keep you cool in the summer heat. This material will absorb sweat fast while at the same time, being soft on your skin. The golf cap has a hook and loop closure at the back that enables you to change the size to meet your needs. The front visor is curved, providing you with ample protection from the sun. With a six-panel construction, this athletic wear will retain its shape even when not worn. This is a must-have accessory when going outdoors. Design your own custom hat using our hat maker. Upload your logo or text and we will create a one-of-a-kind custom hat for you. Features · Material:100% polyester · Curved visor · Sewn eyelets · Hook &amp; loop closure · No minimums · Design your own</p><p><br>&nbsp;</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:05:46', '2025-04-05 15:05:46', NULL),
(537, NULL, NULL, 'Uniform Blue Performance Golf Hat | Oakley', 'uniform-blue-performance-golf-hat-oakley', NULL, '<p>The Oakley Uniform Blue Performance Golf Hat is designed for both style and functionality on the golf course. Crafted from 100% polyester, it offers durability and comfort. The hat features a structured six-panel construction with a mid-crown profile and a pre-curved visor to shield your eyes from the sun. Strategically placed perforations enhance airflow, keeping you cool during play. An adjustable hook and loop closure at the back ensures a customizable fit for various head sizes. The iconic Oakley Ellipse logo adorns the front, adding a touch of brand recognition.</p>', NULL, 33.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:08:32', '2025-04-05 15:08:32', NULL),
(538, NULL, NULL, 'Performance Golf Hat | Imperial', 'performance-golf-hat-imperial', NULL, '<p>Looking to up your game on the green? The Performance Golf Hat from Imperial is just what you need. Made of 100% polyester performance fabric, it\'s lightweight and breathable, with an unstructured six-panel design for a low profile. Plus, the pre-curved visor and grey undervisor keep things cool, while the performance sweatband helps wick away moisture. And last but not least, this adjustable hat features a UPF 50+ rating to help shield you from harmful UV rays. The front two panels provide a wide space to add your custom logo or text using the CapBeast custom hat maker interface.</p><p><br>&nbsp;</p>', NULL, 35.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:22:27', '2025-04-05 15:22:27', NULL),
(539, NULL, NULL, 'White Performance Golf Hat | Imperial', 'white-performance-golf-hat-imperial', NULL, '<p>Looking for an adjustable, performance golf hat that will keep you looking sharp on the green or in the clubhouse? The White Performance Golf Hat is ade with 100% polyester and a performance fabric and is perfect for keeping you cool and comfortable on those hot days out on the course. The unstructured, six-panel design and pre-curved visor also add to your comfort level, while the grey undervisor helps to reduce glare. And if that\'s not enough, this hat also offers UPF 50+ sun protection. The big two-panel front should make your brand stand out when you add a logo or text in the CapBeast hat maker interface.</p><p><br>&nbsp;</p>', NULL, 35.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:24:44', '2025-04-17 04:23:58', '2025-04-17 04:23:58'),
(540, NULL, NULL, 'Black Performance Golf Hat | Imperial', 'black-performance-golf-hat-imperial', NULL, '<p>This hat is made from 100% polyester performance fabric, and features an unstructured, six-panel design with a low profile. The pre-curved visor and grey undervisor are perfect for keeping the sun out of your eyes, while the performance sweatband helps keep you cool and dry. The UPF 50+ rating ensures that you\'ll be protected from the sun\'s harmful rays, and the micro hook-and-loop closure allows you to adjust the fit to your head size. Add your logo or text in using the CapBeast custom hat maker interface to really make it snap.</p><p><br>&nbsp;</p>', NULL, 35.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:26:39', '2025-04-17 04:24:48', '2025-04-17 04:24:48'),
(541, NULL, NULL, 'Dark Gray Performance Golf Hat | Imperial', 'dark-gray-performance-golf-hat-imperial', NULL, '<p>This Dark Grey Performance Golf Hat by Imperial is perfect for those hot, sunny days on the golf course. Made of 100% polyester performance fabric, this hat is lightweight and breathable, with a pre-curved visor and grey undervisor to help keep you cool. The performance sweatband wicks away moisture to keep you dry, while the UPF 50+ protection safeguards your skin from harmful UV rays. This hat also features a micro hook-and-loop closure for a comfortable fit. Give it some pop by adding your logo or text using the CapBeast hat maker.</p><p><br>&nbsp;</p>', NULL, 35.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:28:06', '2025-04-17 04:25:17', '2025-04-17 04:25:17'),
(542, NULL, NULL, 'Frost Gray Performance Golf Hat | Imperial', 'frost-gray-performance-golf-hat-imperial', NULL, '<p>The Frost Grey Performance Golf Hat is perfect for keeping your head cool and protected on those hot days out on the fairway. The fabric is 100% polyester and performance-based to help keep you comfortable, while the structured design ensures a classic, low-profile fit. The grey undervisor helps reduce glare, while the pre-curved visor keeps your vision clear. Best of all, the hat features a moisture-wicking sweatband to help keep you dry. With UPF 50+ protection, this hat can handle whatever the sun throws your way. Adjustable to fit most hat sizes, this is one piece of gear you\'ll be glad you have in your arsenal. Make it special by adding your logo or text using the CapBeast custom hat maker.</p><p><br>&nbsp;</p>', NULL, 35.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:29:52', '2025-04-17 04:25:29', '2025-04-17 04:25:29'),
(543, NULL, NULL, 'True Navy Performance Golf Hat | Imperial', 'true-navy-performance-golf-hat-imperial', NULL, '<p>The True Navy Performance Golf Hat from Imperial is made from 100% polyester performance fabric and features an unstructured, six-panel design with a low profile. The pre-curved visor and grey undervisor provide sun protection, while the performance sweatband helps keep you cool and dry. The micro hook-and-loop closure ensures a comfortable, customized fit. Customize the look even further by adding a logo or text using the CapBeast custom hat maker.</p><p><br>&nbsp;</p>', NULL, 35.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:31:28', '2025-04-17 04:25:36', '2025-04-17 04:25:36'),
(544, NULL, NULL, 'Sphere Dry Hat | Nike', 'sphere-dry-hat-nike', NULL, '<p>This lightweight hat is made from 100% polyester with Sphere Dry moisture control, making it perfect for those hot summer days. The 6-panel design with double mesh insets provides superior ventilation, while the adjustable hook and loop closure ensures a comfortable, customized fit. Plus, the contrast embroidered Swoosh logo on the left side of the bill and center back of the hat adds a touch of style. Whether you\'re working out or just hanging out, the Nike Sphere Dry Hat is a great choice for any activity.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:42:52', '2025-04-05 15:42:52', NULL),
(545, NULL, NULL, 'Charcoal Sphere Dry Hat | Nike', 'charcoal-sphere-dry-hat-nike', NULL, '<p>The Nike Charcoal Sphere Dry Hat is a great choice for athletes who want to keep their head dry and comfortable during intense activity. This hat is made from 100% polyester with Sphere Dry moisture control, so it wicks away sweat quickly. The six-panel design with double mesh insets provides breathability, while the adjustable hook and loop closure ensures a perfect fit. This hat features a contrast embroidered Swoosh logo on the left side of the bill and center back. We embroider your logos or text directly onto the Sphere Dry hat to make it yours.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:54:23', '2025-04-05 15:54:23', NULL),
(546, NULL, NULL, 'Black Sphere Dry Hat | Nike', 'black-sphere-dry-hat-nike', NULL, '<p>For a sporty and stylish hat that will keep you cool and dry during your workout, check out the Black Sphere Dry Hat from Nike. Made from 100% polyester with Sphere Dry moisture control, this hat is perfect for those who like to stay active. It features a 6-panel design with double mesh insets, an adjustable hook and loop closure, and a contrast embroidered Swoosh logo on the left side of the bill and center back of the hat. Plus, it\'s unstructured and has a low profile for a breathable and comfortable fit. So whether you\'re hitting the gym or the streets, this hat is a great choice. This hat from Nike is a canvas to add your custom designs, and we’re here to help you do just that.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:57:23', '2025-04-05 15:57:23', NULL),
(547, NULL, NULL, 'White Sphere Dry Hat | Nike', 'white-sphere-dry-hat-nike', NULL, '<p>The Nike White Sphere Dry Hat is a new way to stay cool and dry on your next golfing adventure or workout. Made with the latest in moisture control technology, this hat will have you feeling ready for any challenge thrown at ya! The low profile design helps keep it hidden away when not in use so no one knows what secret power lies beneath those layers of fabric – namely that there\'s some serious science going down here which makes everything better than ever before. The swoosh logo gives an instant stamp approval while also doubling up as eye-catching decoration casts its beautiful shades against black mesh background. The front panel is a blank canvas accommodating logos up to 2.25” in height, so you can add your design and turn this into a custom Nike hat for your event.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 15:59:18', '2025-04-05 15:59:18', NULL),
(548, NULL, NULL, 'Grey and White Dri-FIT Swoosh Dad Hat | Nike', 'grey-and-white-dri-fit-swoosh-dad-hat-nike', NULL, '<p>Looking for a sharp, clean-cut look that will help you stand out from the competition? Check out the Grey and White Dri-FIT Swoosh Dad Hat. This sleek and stylish hat is perfect for the office or the golf course, and it\'s made with Nike\'s signature Dri-FIT moisture-wicking fabric to keep you cool and comfortable all day long. The Nike Swoosh logo is prominently displayed on the bill and on the back of the hat, leaving plenty of room front and center for your custom-embroidered company logo. So give your brand a boost with the Grey and White Dri-FIT Swoosh Dad Hat!</p><p><br>&nbsp;</p>', NULL, 35.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 16:02:12', '2025-04-05 16:02:12', NULL),
(549, NULL, NULL, 'Game Royal and White Dri-FIT Swoosh Dad Hat | Nike', 'game-royal-and-white-dri-fit-swoosh-dad-hat-nike', NULL, '<p>The Nike Royal and White Dri-FIT Swoosh Perforated Cap is a stylish, functional cap that will keep you cool on those hot summer days. Made from the iconic sportswear company\'s signature fabric - which wicks away moisture to help prevent annoying sweat stains under your helmet or ears--this easygoing option features an adjustable strap so it fits any size head comfortably! With plenty space frontally displayed for custom embroidering plus backprinting in classic colors.</p><p><br>&nbsp;</p>', NULL, 35.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 16:09:13', '2025-04-05 16:09:13', NULL),
(550, NULL, NULL, 'Dri-FIT Mesh Swoosh Flex Sandwich Cap | Nike', 'dri-fit-mesh-swoosh-flex-sandwich-cap-nike', NULL, '<p>Nike\'s Dri-FIT Mesh Swoosh Flex Sandwich Hat is the perfect accessory for any golf enthusiast. This stylish and flexible cap features a moisture-wicking Swoosh Flex sweatband that ensures an exceptional fit, and the embroidered Swoosh design trademark on the bill and center back rounds out the look. Made of 100% polyester knit mesh, this cap is sure to keep you cool and comfortable on even the hottest days. So customized one with your logo and hit the links in style.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 16:13:18', '2025-04-05 16:13:18', NULL),
(551, NULL, NULL, 'Black Dri-FIT Mesh Swoosh Flex Sandwich Cap | Nike', 'black-dri-fit-mesh-swoosh-flex-sandwich-cap-nike', NULL, '<p>The Black Dri-FIT Mesh Swoosh Flex Sandwich Hat from Nike Golf has a structured, mid-profile design and is made of 100% polyester knit mesh. The Swoosh Flex sweatband ensures an exceptional fit, while the contrast Swoosh design trademark is embroidered on the bill and center back in the same color as the trim. Whether you\'re hitting the links or just running errands, this cap is a great choice for any activity. The front of the hat is ready for your designs or logos. It’s as simple as uploading them and ensuring the correct positioning, and we do the rest with our state-of-the-art digital embroidery machines.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 16:15:28', '2025-04-05 16:15:28', NULL),
(552, NULL, NULL, 'Red Dri-FIT Mesh Swoosh Flex Sandwich Cap | Nike', 'red-dri-fit-mesh-swoosh-flex-sandwich-cap-nike', NULL, '<p>The Nike Golf Red Dri-FIT Mesh Swoosh Flex Sandwich Hat is a moisture-wicking cap that\'s both flexible and stylish! This hat has a structured, mid-profile design and is made of 100% polyester knit mesh. The Swoosh Flex sweatband ensures an exceptional fit, while the contrast Swoosh design trademark is embroidered on the bill and center back in the same color as the trim. So whether you\'re hitting the links or just running errands, do it in style with the Nike Golf Red Dri-FIT Mesh Swoosh Flex Sandwich Hat.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 16:16:40', '2025-04-05 16:16:40', NULL),
(553, NULL, NULL, 'White Dri-FIT Mesh Swoosh Flex Sandwich Cap | Nike', 'white-dri-fit-mesh-swoosh-flex-sandwich-cap-nike', NULL, '<p>The Nike White Dri-FIT Mesh Swoosh Flex Sandwich Hat has a structured, mid-profile design and is made of 100% polyester knit mesh. The Swoosh Flex sweatband ensures an exceptional fit, while the contrast Swoosh design trademark is embroidered on the bill and center back in the same color as the trim. Whether you\'re hitting the links or just running errands, this cap will keep you cool and comfortable all day long.</p><p><br>&nbsp;</p>', NULL, 34.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 16:18:02', '2025-04-05 16:18:02', NULL),
(554, NULL, NULL, 'Featherlight Cap | Nike', 'featherlight-cap-nike', NULL, '<p>For a cap that won\'t hold you back, the Nike Featherlight is just what you need. Made from 100% Dri-FIT polyester twill, it\'s incredibly light and breathable. And with mesh panels for enhanced airflow, you\'ll stay cool and comfortable even when the heat is on. Plus, the contrast embroidered Swoosh logo adds a touch of style. The unstructured fabric lends well to lettering and less dense logos. Upload yours and we’ll stitch it to make this a truly custom NIke hat. Whether you\'re working out or just running around town, the Nike Featherlight Cap has got you covered.</p><p><br>&nbsp;</p>', NULL, 36.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 16:24:12', '2025-04-05 16:24:12', NULL),
(555, NULL, NULL, 'Black Featherlight Cap | Nike', 'black-featherlight-cap-nike', NULL, '<p>Nike\'s Black Featherlight Cap is perfect for athletes who want to keep their head cool and dry during intense workouts. Made from 100% Dri-FIT polyester twill, this six-panel cap features mesh panels for enhanced breathability, a contrast embroidered Swoosh logo on the left side, and an adjustable hook and loop closure for a snug, comfortable fit. Moisture-wicking and unstructured, the Black Featherlight Cap is your go-to choice for a lightweight, low-profile cap that won\'t weigh you down. Upload your logo and we’ll custom embroider it on the front, side, or back panel of the Nike Featherlight to make it uniquely yours.</p><p><br>&nbsp;</p>', NULL, 36.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 16:26:36', '2025-04-05 16:26:36', NULL),
(556, NULL, NULL, 'College Navy Featherlight Cap | Nike', 'college-navy-featherlight-cap-nike', NULL, '<p>For a cool and comfortable way to show your support for your favorite team, check out the Nike Featherlight Cap in the classic College Navy colorway. Made from 100% Dri-FIT polyester twill, this 6-panel cap features mesh panels for enhanced breathability, and a contrast embroidered Swoosh logo on the left side. It\'s also unstructured and has a low profile for a clean, modern look. Plus, the moisture-wicking fabric keeps you cool and dry even when the game heats up. So whether you\'re tailgating or going for a run, the Nike College Navy Featherlight Cap is a great choice for a custom hat.</p><p><br>&nbsp;</p>', NULL, 36.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 16:28:23', '2025-04-05 16:28:23', NULL),
(557, NULL, NULL, 'White Featherlight Cap | Nike', 'white-featherlight-cap-nike', NULL, '<p>Introducing the White Featherlight Cap from Nike. This sleek and functional cap is made from 100% Dri-FIT polyester twill and features 6-panel construction, adjustable hook and loop closure, and mesh panels for enhanced breathability. The contrast embroidered Swoosh logo on the left side of the hat adds a touch of style, while the unstructured design and low profile make this cap ultra comfortable to wear. Moisture wicking properties keep you cool and dry, even during intense physical activity. Whether you\'re working out or just running errands, the White Featherlight Cap from Nike will showcase your logo or design with style. Customize the front or side panels by adding your logo and we will stitch it to perfection.</p><p><br>&nbsp;</p>', NULL, 36.00, NULL, 'cm', 1, 12, 9, 'lbs', 0.60, 1, '2025-04-05 16:30:01', '2025-04-05 16:30:01', NULL),
